import React from 'react';
import './FaceRecognition.css'; 

const FaceRecognition = ({userImage})=>{
return (
    <div className='center'>
        <img className= "center" src={userImage} alt="Black model with golden blonde wig red lips " />
    </div>
);
}

export default FaceRecognition;
